import React, { Component } from 'react';

import { Container, Button } from 'react-bootstrap';

class Far extends Component {
    state = { 
        name: "nasir",
        bttext: "I am a big button"
     };


    render() { 
        return ( 
        <div className = " align-items-center">
            <Container fluid>
            <Button variant="outline-primary mg-2">{this.state.name}</Button>{' '}
            </Container>
        </div>
        );
    }
}

export default Far;
